  null,\n\t\"notes\": \"A meteorological data system was designed, assembled, and
  installed to obtain, on a continuous basis, wind and temperature information at
  12 levels on a television transmitting tower 1434 ft in height. Measurement and
  recording of atmospheric variables was accomplished entirely automatically, the
  output being in the form of punched paper tape and a record prepared by an electric
  typewriter. The tower used as an instrument support was triangular in cross section,
  measuring 12 ft on a side with no taper, was extensively guyed, contained a 2000-lb
  capacity elevator, and was capped by a triangular superstructure 75 ft on a side
  and about 14 ft high.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
